import './App.css';
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './views/home/Home';
import Header from './componentes/header/Header';
import Login from './views/LoginYregistro/Login';
import Registro from './views/LoginYregistro/Registro';
import Error from './componentes/error/Error';
import IdeaIndividual from './views/IdeaIndividual/IdeaIndividual';




function App() {
  return (
    <div className="App bg-light " style={{ height: "100vh" }}>
      <Header />
      <Routes>
        <Route path="/" element={<Home />}></Route>
        <Route path="/login" element={<Login />}></Route>
        <Route path="/registro" element={<Registro />}></Route>
        <Route path="/idea/:ideaID" element={<IdeaIndividual />}></Route>


        <Route  element={<Error />} />

      </Routes>
    </div>
  );
}

export default App;
